import React, { Component } from 'react'
import PageNavbar from "./PageNavbar";

export default class Compare extends Component {
    constructor(props) {
        super()
        this.state = {
            country1 : '',
            countryList1 : [],
            country2 : '',
            countryList2 : []
        }
        this.handleChange = this.handleChange.bind(this)
    }

    componentDidMount(){
        fetch("http://localhost:8081/compare", {match : "GET"})
        .then((res)=>res.json())
        .then((results)=>{
            var updatedCountryList = []
            for (var i = 0; i < results.length; i++) {
                updatedCountryList.push(results[i].country)
            }
            this.setState({
                countryList1 : updatedCountryList
            })
        })
    }

    handleChange() {

    }

    render() {
        return (
            <div>
                <PageNavbar active="compare"/>
                <div>
                    <select name="country1" value={this.state.country1} onChange={this.handleChange} placeholder='Please select a country'>
                        {this.state.countryList1.map((ele, idx) => 
                            <option value={ele}>
                                {ele}
                            </option>
                        )}
                    </select>
                </div>
            </div>
        )
    }
}
